import React from "react";

const NotFound = () => {
  return (
    <section class="hero is-danger">
    <div class="hero-body">
      <p class="title">
        NOT FOUND
      </p>
      <p class="subtitle">
      Sorry! We could not find what you are looking for!
      </p>
    </div>
  </section>
  );
};

export default NotFound;
